import React from "react";
import "./style.css";

function ImageCard(props) {
  return (
    <div className="card">
      <div
        onClick={() => props.handleHeroClick(props.id)}
        className="img-container"
      >
        <img alt={props.name} src={props.image} />
      </div>
    </div>
  );
}

export default ImageCard;
